var b="url",c="排程参数设置_ui_105_001_007_.html",d="generationDate",e=new Date(1629706772761.4),f="defaultAdaptiveView",g="name",h="",i="size",j="width",k=0,l="height",m="adaptiveViews",n="sketchKeys",o="s0",p="variables",q="OnLoadVariable",r="time",s="captcha",t="qidongye",u="page",v="packageId",w="6bdd4f0740964629ad414f2037e0618d",x="type",y="Axure:Page",z="排程参数设置(UI_105_001_007)",A="notes",B="annotations",C="fn",D="1",E="ownerId",F="cb7cd57588604b4b9b657b0b223c320b",G="label",H="地点编码/名称",I="前端",J="<p><span style=\"font-family:'Arial Normal', 'Arial';text-decoration:none;\">单选，下拉列表展示物料编号/物料名</span></p>",K="2",L="740f27e9f0d042bc9eb440a587c48650",M="预计恢复时间",N="功能逻辑",O="<p><span style=\"font-family:'Arial Normal', 'Arial';text-decoration:none;color:#333333;\">现场保修反馈的时间</span></p>",P="3",Q="e39fdbda889e4013bcce396d05f54559",R="计划恢复时间",S="<p><span style=\"font-family:'Arial Normal', 'Arial';text-decoration:none;color:#333333;\">计算产能时计划员预估入产能的开始时间</span></p>",T="4",U="1eead07889d84867a2946c0e531eb373",V="请填写",W="<p><span style=\"font-family:'Arial Normal', 'Arial';text-decoration:none;\">计数器</span></p>",X="5",Y="0320db3f24604c7ba24e30c7f1f3a582",Z="工序排序方案：",ba="<p><span style=\"font-family:'Arial Normal', 'Arial';text-decoration:none;\">常规方案：</span></p><p><span style=\"font-family:'Arial Normal', 'Arial';text-decoration:none;\">1. 将相同工单的待排程工序分为一组。</span></p><p><span style=\"font-family:'Arial Normal', 'Arial';text-decoration:none;\">2. 分组之间按所设置的工单排程优先级排列。</span></p><p><span style=\"font-family:'Arial Normal', 'Arial';text-decoration:none;\">3. 分组内按照工艺路线的顺序排列。</span></p><p><span style=\"font-family:'Arial Normal', 'Arial';text-decoration:none;\">最小换型时间方案：</span></p><p><span style=\"font-family:'Arial Normal', 'Arial';text-decoration:none;\">1.取待排程工序中工单计划开始时间最早的时间为开始，每「约整天数」内计划开始的工单的待排程工序分为一大组。</span></p><p><span style=\"font-family:'Arial Normal', 'Arial';text-decoration:none;\">2. 大组之间按计划时间升序排列。</span></p><p><span style=\"font-family:'Arial Normal', 'Arial';text-decoration:none;\">3. 大组内将相同工序产出物料的待排程工序分为一小组。</span></p><p><span style=\"font-family:'Arial Normal', 'Arial';text-decoration:none;\">4. 小组之间按照组内工序所在工单优先级均值降序排列。</span></p><p><span style=\"font-family:'Arial Normal', 'Arial';text-decoration:none;\">5. 小组内按照待排程工序所在工单优先级降序排列。</span></p>",bb="6",bc="e7ba3ffdd8bf4005a29cd4e60a3ca967",bd="工位排序方案：",be="<p><span style=\"font-family:'Arial Normal', 'Arial';text-decoration:none;\">N型排产：</span></p><p><span style=\"font-family:'Arial Normal', 'Arial';text-decoration:none;\">1. 每次将待排程工序放在结束时间最早的工位上。</span></p><p><span style=\"font-family:'Arial Normal', 'Arial';text-decoration:none;\">Z型排产：</span></p><p><span style=\"font-family:'Arial Normal', 'Arial';text-decoration:none;\">1. 将待排程工位按照首个待排程工序的结束时间升序排列。</span></p><p><span style=\"font-family:'Arial Normal', 'Arial';text-decoration:none;\">2. 将待排程工序依次放入工位队列中的第一个直至超出截止时间。</span></p><p><span style=\"font-family:'Arial Normal', 'Arial';text-decoration:none;\">3. 将超出截止时间的待排程工序放入工位队列中的下一个直至工位队列为空。</span></p><p><span style=\"font-family:'Arial Normal', 'Arial';text-decoration:none;\">4. 剩下的待排程工序排程失败。</span></p>",bf="7",bg="095cb46a2f4043fb93531a37cbaa1be5",bh="工序排程优先级：",bi="<p><span style=\"font-family:'Arial Normal', 'Arial';text-decoration:none;\">支持拖拽调整排程优先级，工单计划开始/结束时间为空的工单默认排在不为空的工单之后</span></p>",bj="8",bk="7582ccb562b2444b80ea0066fb401d29",bl="(图片)",bm="<p><span style=\"font-family:'Arial Normal', 'Arial';text-decoration:none;\">可上下调整优先级</span></p>",bn="style",bo="baseStyle",bp="627587b6038d43cca051c114ac41ad32",bq="pageAlignment",br="near",bs="fill",bt="fillType",bu="solid",bv="color",bw=0xFFFFFFFF,bx="image",by="imageAlignment",bz="imageRepeat",bA="auto",bB="favicon",bC="sketchFactor",bD="0",bE="colorStyle",bF="appliedColor",bG="fontName",bH="Applied Font",bI="borderWidth",bJ="borderVisibility",bK="borderFill",bL=0xFF797979,bM="cornerRadius",bN="cornerVisibility",bO="outerShadow",bP="on",bQ=false,bR="offsetX",bS=5,bT="offsetY",bU="blurRadius",bV="r",bW=0,bX="g",bY="b",bZ="a",ca=0.349019